package org.xmldap.infocard.roaming;

import java.io.ByteArrayInputStream;
import java.io.ByteArrayOutputStream;

import nu.xom.ParsingException;

import org.xmldap.exceptions.CryptoException;
import org.xmldap.infocard.InfoCard;
import org.xmldap.infocard.policy.SupportedClaim;
import org.xmldap.infocard.policy.SupportedClaimList;
import org.xmldap.infocard.policy.SupportedToken;
import org.xmldap.infocard.policy.SupportedTokenList;

import junit.framework.TestCase;

public class TestEncryptedStore extends TestCase {

	EncryptedStore es = null;
	static String password = "test";
	static final String esXmlStr = "ï»¿<?xml version=\"1.0\" encoding=\"utf-8\"?><EncryptedStore xmlns=\"http://schemas.xmlsoap.org/ws/2005/05/identity\"><StoreSalt>MDEyMzQ1Njc4OTAxMjM0NQ==</StoreSalt><EncryptedData xmlns=\"http://www.w3.org/2001/04/xmlenc#\"><CipherData><CipherValue></CipherValue></CipherData></EncryptedData></EncryptedStore>";
	
	protected void setUp() throws Exception {
		super.setUp();
		RoamingStore roamingStore = new RoamingStore();
		InfoCard card = new InfoCard();
		card.setCardId("card1");
		card.setCardVersion(1);
		card.setIssuer("issuer");
		card.setTimeIssued("2006-09-28T12:58:26Z");
		{
			SupportedClaimList claimList = new SupportedClaimList();
			String displayName = "displayName";
			String uri = "uri";
			String description = "description";
			SupportedClaim claim = new SupportedClaim(displayName, uri, description);
			claimList.addSupportedClaim(claim);
			card.setClaimList(claimList);
		}
		{
			SupportedTokenList tokenList = new SupportedTokenList();
			SupportedToken token = new SupportedToken(); // default is SAML11
			tokenList.addSupportedToken(token);
			card.setTokenList(tokenList);
		}
		
		RoamingInformationCard ric = new RoamingInformationCard(card);
		roamingStore.addRoamingInformationCard(ric);
		byte[] salt = "0123456789012345".getBytes();
		byte[] iv = "1234567890123456".getBytes();
		es = new EncryptedStore(roamingStore, password, salt, iv);
	}

	public void testCipherValue() throws CryptoException {
		String esStr = es.getEncryptedStoreString();
		String expected = "";
		assertEquals(expected, esStr);
	}
	
	public void testXml() throws CryptoException {
		ByteArrayOutputStream baos = new ByteArrayOutputStream();
		es.toStream(baos);
		String xml = baos.toString();
		assertEquals(esXmlStr, xml);
	}
	
	public void testDecrypt() throws CryptoException, ParsingException {
		ByteArrayInputStream bais = new ByteArrayInputStream(esXmlStr.getBytes());
		EncryptedStore storeFromStream = new EncryptedStore(bais, password);
		String roamingStore = storeFromStream.getRoamingStoreString();
		String expectedRoamingStore = "<RoamingStore xmlns=\"http://schemas.xmlsoap.org/ws/2005/05/identity\"><RoamingInformationCard><InformationCardMetaData xml:lang=\"en\"><ic:InformationCardReference xmlns:ic=\"http://schemas.xmlsoap.org/ws/2005/05/identity\"><ic:CardId>card1</ic:CardId><ic:CardVersion>1</ic:CardVersion></ic:InformationCardReference><ic:CardImage xmlns:ic=\"http://schemas.xmlsoap.org/ws/2005/05/identity\" MimeType=\"image/png\"></ic:CardImage><ic:Issuer xmlns:ic=\"http://schemas.xmlsoap.org/ws/2005/05/identity\">issuer</ic:Issuer><ic:TimeIssued xmlns:ic=\"http://schemas.xmlsoap.org/ws/2005/05/identity\">2006-09-28T12:58:26Z</ic:TimeIssued><ic:TimeExpires xmlns:ic=\"http://schemas.xmlsoap.org/ws/2005/05/identity\">9999-12-31T23:59:59.9999999Z</ic:TimeExpires><ic:SupportedTokenTypeList xmlns:ic=\"http://schemas.xmlsoap.org/ws/2005/05/identity\"><wst:TokenType xmlns:wst=\"http://schemas.xmlsoap.org/ws/2005/02/trust\">urn:oasis:names:tc:SAML:1.0:assertion</wst:TokenType></ic:SupportedTokenTypeList><ic:SupportedClaimTypeList xmlns:ic=\"http://schemas.xmlsoap.org/ws/2005/05/identity\"><ic:SupportedClaimType Uri=\"uri\"><ic:DisplayTag>displayName</ic:DisplayTag><ic:Description>description</ic:Description></ic:SupportedClaimType></ic:SupportedClaimTypeList><IsSelfIssued>true</IsSelfIssued><HashSalt>Y2FyZDE=</HashSalt><TimeLastUpdated>2006-09-28T12:58:26Z</TimeLastUpdated><IssuerId /><IssuerName>Self</IssuerName><BackgroundColor>16777215</BackgroundColor></InformationCardMetaData><InformationCardPrivateData><MasterKey>Y2FyZDE=</MasterKey><ClaimValueList><ClaimValue Uri=\"http://schemas.xmlsoap.org/ws/2005/05/identity/claims/givenname\"><Value>Chuck</Value></ClaimValue><ClaimValue Uri=\"http://schemas.xmlsoap.org/ws/2005/05/identity/claims/surname\"><Value>Mortimore</Value></ClaimValue><ClaimValue Uri=\"http://schemas.xmlsoap.org/ws/2005/05/identity/claims/emailaddress\"><Value>cmort@xmldap.org</Value></ClaimValue></ClaimValueList></InformationCardPrivateData></RoamingInformationCard></RoamingStore>";
		assertEquals(expectedRoamingStore, roamingStore);
	}
	
}
